import React from 'react';
import PixChatBlack from '../../assets/pixchat-black.svg';

const PiXChatBlack = () => (
  <div className="PiXChatIcon-Component">
    <img src={PixChatBlack} className="pixchaticon" id="pixchaticon" alt="pixchaticon-here" />
  </div>
);

export default PiXChatBlack;
